export default function RoomIntro(props){
    console.log(props.images);
    
    return(
      <div>
        {props.images.map((image, index) => (
          <div key={index}>
            <img className="" src={image} alt="" />
            <div className="relative">
              <p className="font-delafield text-9xl absolute">Miles</p>
              {/* <p className="font-baby absolute">Room A</p> */}
              <p>{props.title}</p>
              <p>{props.desc}</p>
            </div>
          </div>
        ))}
      </div>
    );
  }
